import "./App.css";
import Hotel from "./components/Hotel/Hotel";

const App = () => {
  const dummy = [
    "Ciputra",
    "Tran Hung Dao, Hanoi, Vietnam",
    "80%",
    true,
    "double",
    "breakfast",
    "1000$",
    "./components/imgs/foto1.jpg",
  ];

  return (
    <Hotel
      name={dummy[0]}
      location={dummy[1]}
      rate={dummy[2]}
      oceanview={dummy[3]}
      roomtype={dummy[4]}
    ></Hotel>
  );
};

export default App;

